import { Container } from "../../styles/LayoutStyles";
import { Title } from "../../styles/TextStyles";

export default function Layout({ children }) {
  return (
    <>
      <main>
        <Container>
          <Title>Octavan Web Project</Title>
          {children}
        </Container>
      </main>
      <footer>Desinged for Octavan</footer>
    </>
  );
}
